import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Carou from "./carou";

const Carousel = () => {
  const settings = {
    dots:false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    customPaging: (i) => <Carou index={i} />,
    appendDots: (dots) => (
      <div
        style={{
          position: "absolute",
          bottom: "20px",
          width: "100%",
        }}
      >
        <ul className="flex justify-center m-0">{dots}</ul>
      </div>
    ),
  };

  return (
    <div className="bg-black h-screen w-screen flex items-center justify-center">
      <div className="bg-gray-900 h-4/5 w-11/12 max-w-lg max-h-lg">
        <Slider {...settings}>
          <div>
            <Carou index={0} />
          </div>
          <div>
            <iframe
              title="iframe1"
              src="https://drcardenal.com.br"
              width="100%"
              height="100%"
            />
          </div>
          <div>
            <iframe
              title="iframe2"
              src="https://smartkonelevadores.com.br"
              width="100%"
              height="100%"
            />
          </div>
        </Slider>
      </div>
    </div>
  );
};

export default Carousel;
